import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';
import galerry from './pages/Gallery';


function Routers() {
  return (
    <BrowserRouter>
        <Route path="/galerry" exact component={galerry}/> 
    </BrowserRouter>
  );
}

export default Routers;
